(16, 1, 1, 'Décorations de Noël', '<p style=\"text-align:justify;\">Les fêtes de <span style=\"color:#bb0915;\"><strong>Noël </strong></span>sont là ! C\'est l\'heure de décorer son intérieur &amp; extérieur ! Chez \"Christmas time\" vous trouverez un large choix de décorations. Les fêtes de <span style=\"color:#000000;\">Noël </span>sont là ! C\'est l\'heure de décorer son intérieur &amp; extérieur ! Chez \"Christmas time\" vous trouverez un large choix de décorations. </p>\r\n<p style=\"text-align:justify;\">Les fêtes de <span>Noël </span>sont là ! C\'est l\'heure de décorer son intérieur &amp; extérieur ! Chez \"Christmas time\" vous trouverez un large choix de décorations.</p>', 'decorations-de-noel', 'Décorations de Noël', 'mot clé', 'Meta description'),
(16, 1, 2, 'Weihnachtsdekorationen', '<p>Die Weihnachtsfeiern sind da! Es ist Zeit, Ihr Interieur und Exterieur zu dekorieren! Zur „Weihnachtszeit“ finden Sie eine große Auswahl an Dekorationen. Die Weihnachtsfeiern sind da! Es ist Zeit, Ihr Interieur und Exterieur zu dekorieren! Zur „Weihnachtszeit“ finden Sie eine große Auswahl an Dekorationen.</p>\r\n<p>Die Weihnachtsfeiern sind da! Es ist Zeit, Ihr Interieur und Exterieur zu dekorieren! Zur „Weihnachtszeit“ finden Sie eine große Auswahl an Dekorationen.</p>', 'weihnachtsdekorationen', '', '', ''),
(16, 1, 3, 'Kerst Versiering', '<p>De kerstfeestjes zijn er! Het is tijd om je interieur &amp; exterieur te decoreren! Bij \"Kersttijd\" vindt u een ruime keuze aan decoraties. De kerstfeestjes zijn er! Het is tijd om je interieur &amp; exterieur te decoreren! Bij \"Kersttijd\" vindt u een ruime keuze aan decoraties.</p>\r\n<p>De kerstfeestjes zijn er! Het is tijd om je interieur &amp; exterieur te decoreren! Bij \"Kersttijd\" vindt u een ruime keuze aan decoraties.</p>', '-kerst-versiering', '', '', ''),
(16, 1, 4, 'Christmas Decorations', '<p>The Christmas parties are here! It\'s time to decorate your interior &amp; exterior! At \"Christmas time\" you will find a wide selection of decorations. The Christmas parties are here! It\'s time to decorate your interior &amp; exterior! At \"Christmas time\" you will find a wide selection of decorations.</p>\r\n<p>The Christmas parties are here! It\'s time to decorate your interior &amp; exterior! At \"Christmas time\" you will find a wide selection of decorations.</p>', '-christmas-decorations', 'Décorations de Noël', '', ''),
(16, 1, 5, 'Decoraciones de Navidad', '<p>¡Llegaron las fiestas navideñas! ¡Es hora de decorar tu interior y exterior! En \"Tiempo de Navidad\" encontrarás una amplia selección de decoraciones. ¡Llegaron las fiestas navideñas! ¡Es hora de decorar tu interior y exterior! En \"Tiempo de Navidad\" encontrarás una amplia selección de decoraciones.</p>\r\n<p>¡Llegaron las fiestas navideñas! ¡Es hora de decorar tu interior y exterior! En \"Tiempo de Navidad\" encontrarás una amplia selección de decoraciones.</p>', 'decoraciones-de-navidad', 'Décorations de Noël', '', ''),
(16, 1, 6, 'Decorazioni Natalizie', '<p>Le feste di Natale sono qui! È tempo di decorare i tuoi interni ed esterni! Al \"periodo natalizio\" troverai un\'ampia scelta di addobbi. Le feste di Natale sono qui! È tempo di decorare i tuoi interni ed esterni! Al \"periodo natalizio\" troverai un\'ampia scelta di addobbi.</p>\r\n<p>Le feste di Natale sono qui! È tempo di decorare i tuoi interni ed esterni! Al \"periodo natalizio\" troverai un\'ampia scelta di addobb</p>', 'decorazioni-natalizie', 'Décorations de Noël', '', ''),
