(60, 1, 1, 'Naturel', '<p>Notre société provient de Belgique, plus précisément en Wallonie qui est le deuxième producteur européen de sapins naturels !</p>\r\n<p>Son volume de production atteint presque les deux millions d\'arbres chaque année !</p>\r\n<p>Une fois les fêtes passées, un sapin naturel devient un déchet vert. </p>', 'naturel', '', '', ''),
