(62, 1, 1, 'En bois', '<p>Sapins de Noël en bois déjà utilisé! What?! Oui effctivement le bois que nous utilisons pour fabriquer nos sapins est du bois recyclé ! Bien, non? </p>\r\n<p>\"Donnez leurs une chance d\'avoir une seconde vie ! \"</p>', 'en-bois', '', '', ''),
(62, 1, 2, 'In Holz', '<p>Gebrauchte Weihnachtsbäume aus Holz! Was?! Ja, das Holz, aus dem wir unsere Bäume herstellen, ist tatsächlich recyceltes Holz! Nun nein?</p>\r\n<p>\"Geben Sie ihnen die Chance auf ein zweites Leben!\"</p>', '-in-holz', '', '', ''),
(62, 1, 3, 'In hout', '<p>Gebruikte houten kerstbomen! Wat?! Ja, inderdaad, het hout dat we gebruiken om onze bomen te maken, is gerecycled hout! Welnee?</p>\r\n<p>\"Geef ze een kans op een tweede leven!\"</p>', '-in-hout', '', '', ''),
(62, 1, 4, 'In wood', '<p>Used wooden Christmas trees! What?! Yes indeed the wood we use to make our trees is recycled wood! Well no?</p>\r\n<p>\"Give them a chance to have a second life!\"</p>', '-in-wood', '', '', ''),
(62, 1, 5, 'De madera', '<p>¡Árboles de Navidad de madera usados! ¡¿Qué?! ¡Sí, de hecho, la madera que usamos para hacer nuestros árboles es madera reciclada! ¿Bueno no?</p>\r\n<p>\"¡Denles la oportunidad de tener una segunda vida!\"</p>', '-de-madera', '', '', ''),
(62, 1, 6, 'In legno', '<p>Alberi di Natale in legno usati! Che cosa?! Sì, il legno che utilizziamo per realizzare i nostri alberi è legno riciclato! Beh no? \"Dai loro la possibilità di avere una seconda vita!\"</p>', '-in-legno', '', '', ''),
