INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(26, 1, 1, '<p>Longueur: 60 cm</p>\r\n<p>Largeur: 30 cm</p>\r\n<p>Bois naturel </p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/SAPIN%20EN%20BOIS.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Joli sapin de Noël en bois qui décorera chaleureusement votre intérieur de maison.</p>', 'sapin-en-bois', 'Sapin de Noël en bois recyclé', '', 'Sapin de Noël en bois', 'Sapin en bois 60 cm', '', '', '', ''),
(26, 1, 2, '<p>Länge: 60cm</p>\r\n<p>Breite: 30 cm</p>\r\n<p>natürliches Holz</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/SAPIN%20EN%20BOIS.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Hübscher Weihnachtsbaum aus Holz, der Ihr Zuhause gemütlich schmücken wird.</p>', '-hoelzerner-baum', '', '', '', 'Hölzerner Baum 60 cm', '', '', '', ''),
(26, 1, 3, '<p>Lengte: 60 cm</p>\r\n<p>Breedte: 30cm</p>\r\n<p>Natuurlijk hout</p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/SAPIN%20EN%20BOIS.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Mooie houten kerstboom die je interieur warm zal decoreren.</p>', '-houten-boom', '', '', '', 'Houten boom 60 cm', '', '', '', ''),
(26, 1, 4, '<p>Length: 60cm</p>\r\n<p>Width: 30cm</p>\r\n<p>Natural wood</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/SAPIN%20EN%20BOIS.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Pretty wooden Christmas tree that will warmly decorate your home interior.</p>', 'wooden-tree', '', '', '', 'Wooden tree 60 cm', '', '', '', ''),
(26, 1, 5, '<p>Longitud: 60 cm</p>\r\n<p>Ancho: 30cm</p>\r\n<p>madera natural</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/SAPIN%20EN%20BOIS.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Bonito árbol de Navidad de madera que decorará cálidamente el interior de su hogar.</p>', '-arbol-de-madera', '', '', '', 'árbol de madera 60 cm', '', '', '', ''),
(26, 1, 6, '<p>Lunghezza: 60 cm</p>\r\n<p>Larghezza: 30cm</p>\r\n<p>legno naturale</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/SAPIN%20EN%20BOIS.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Grazioso albero di Natale in legno che decorerà calorosamente gli interni della tua casa.</p>', 'albero-di-legno', '', '', '', 'Albero di legno 60 cm', '', '', 'Livraison entre 4 à 5 jours', 'Livraison entre 11 à 12 jours'),
(27, 1, 1, '<p>Notre société provient de Belgique, plus précisément en Wallonie qui est le deuxième producteur européen de sapins naturels !</p>\r\n<p>Son volume de production atteint presque les deux millions d\'arbres chaque année.</p>\r\n<p>Une fois les fêtes passées, un sapin naturel devient un déchet vert. </p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" style=\"margin-left:auto;margin-right:auto;\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/Sapin_Noel.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Sapin de Noël écologique</p>', 'sapin-de-noel-ecologique', 'Sapin de Noël Naturel', '', 'Sapin de Noël naturel', 'Sapin de Noël naturel 1M', '', '', 'Livraison 4 à 5 jours', 'Livraison 11 à 12 jours'),
(27, 1, 2, '<p>Unser Unternehmen stammt aus Belgien, genauer gesagt aus Wallonien, dem zweitgrößten europäischen Produzenten von Naturbäumen!</p>\r\n<p>Das Produktionsvolumen erreicht jedes Jahr fast zwei Millionen Bäume.</p>\r\n<p>Nach den Ferien wird aus einem Naturbaum Grünabfall.</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/Sapin_Noel.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Ökologischer Weihnachtsbaum</p>', 'sapin-de-noel-ecologique', '', '', '', 'Natürlicher Weihnachtsbaum 1M', '', '', '', ''),
(27, 1, 3, '<p>Ons bedrijf komt uit België, meer bepaald uit Wallonië, de tweede Europese producent van natuurlijke bomen!</p>\r\n<p>Het productievolume bereikt bijna twee miljoen bomen per jaar.</p>\r\n<p>Na de feestdagen wordt een natuurlijke boom groenafval.</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/Sapin_Noel.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Ecologische kerstboom</p>', 'sapin-de-noel-ecologique', '', '', '', 'Natuurlijke kerstboom 1M', '', '', '', ''),
(27, 1, 4, '<p>Our company comes from Belgium, more precisely in Wallonia which is the second European producer of natural trees!</p>\r\n<p>Its production volume reaches almost two million trees each year.</p>\r\n<p>Once the holidays are over, a natural tree becomes green waste.</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/Sapin_Noel.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Ecological Christmas tree</p>', 'sapin-de-noel-ecologique', '', '', '', 'Natural Christmas tree 1M', '', '', '', ''),
(27, 1, 5, '<p>¡Nuestra empresa proviene de Bélgica, más precisamente de Valonia, que es el segundo productor europeo de árboles naturales!</p>\r\n<p>Su volumen de producción alcanza casi dos millones de árboles cada año.</p>\r\n<p>Una vez pasadas las vacaciones, un árbol natural se convierte en desecho verde.</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/Sapin_Noel.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Árbol de navidad ecológico</p>', 'sapin-de-noel-ecologique', '', '', '', 'Arbol de navidad natural 1M', '', '', '', ''),
(27, 1, 6, '<p>La nostra azienda viene dal Belgio, più precisamente in Vallonia che è il secondo produttore europeo di alberi naturali!</p>\r\n<p>Il suo volume di produzione raggiunge quasi due milioni di alberi ogni anno.</p>\r\n<p>Una volta terminate le vacanze, un albero naturale diventa un rifiuto verde.</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/Sapin_Noel.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Albero di Natale ecologico</p>', 'sapin-de-noel-ecologique', '', '', '', 'Albero di Natale naturale 1M', '', '', '', ''),
(28, 1, 1, '<p>Jolie boule de Noël pour décorer son sapin de Noël</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/BOULES%20DE%20NOEL%20ROUGE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Boule de Noël rouge</p>', 'boule-de-noel-rouge', 'Boule de Noël', '', 'Boule de Noël', 'Boule de Noël rouge', '', '', 'Livraison entre 3 à 4 jours', 'Livraison entre 11 et 14 jours'),
(28, 1, 2, '<p>Hübsche Weihnachtskugel, um Ihren Weihnachtsbaum zu schmücken</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/BOULES%20DE%20NOEL%20ROUGE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Rote Weihnachtskugel</p>', 'boule-de-noel-rouge', '', '', '', 'Rote Weihnachtskugel', '', '', '', ''),
(28, 1, 3, '<p>Mooie kerstbal om je kerstboom mee te versieren.</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/BOULES%20DE%20NOEL%20ROUGE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Rode kerstbal</p>', 'boule-de-noel-rouge', '', '', '', 'Rode kerstbal', '', '', '', ''),
(28, 1, 4, '<p>Pretty Christmas ball to decorate your Christmas tree.</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/BOULES%20DE%20NOEL%20ROUGE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Red Christmas ball</p>', 'boule-de-noel-rouge', '', '', '', 'Red Christmas ball', '', '', '', ''),
(28, 1, 5, '<p>Bonita bola navideña para decorar tu árbol de Navidad.</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/BOULES%20DE%20NOEL%20ROUGE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>bola de navidad roja</p>', 'boule-de-noel-rouge', '', '', '', 'Bola de navidad roja', '', '', '', ''),
(28, 1, 6, '<p>Bella palla di Natale per decorare il tuo albero di Natale.</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/BOULES%20DE%20NOEL%20ROUGE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Palla di Natale rossa</p>', 'boule-de-noel-rouge', '', '', '', 'Palla di Natale rossa', '', '', '', ''),
(29, 1, 1, '<p>Jolie couronne pour décorer la d\'entrée de votre maison !</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/COURONNE%20DE%20NOEL.mp4\" type=\"video/mp4\"></source>\r\n</video>', '', 'couronne-de-noel', 'Couronne de Noël', '', 'Couronne de Noël', 'Couronne de Noël', '', '', 'Livraison 3 à 5 jours', 'Livraison 11 à 15 jours'),
(29, 1, 2, '<p>Hübscher Kranz, um den Eingang Ihres Hauses zu schmücken!</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/COURONNE%20DE%20NOEL.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Weihnachtskranz</p>', 'couronne-de-noel', '', '', '', 'Weihnachtskranz', '', '', '', ''),
(29, 1, 3, '<p>Mooie krans om de ingang van je huis te versieren!</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/COURONNE%20DE%20NOEL.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Kerst krans</p>', 'couronne-de-noel', '', '', '', 'Kerst krans', '', '', '', ''),
(29, 1, 4, '<p>Pretty wreath to decorate the entrance of your home!</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/COURONNE%20DE%20NOEL.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Christmas wreath</p>', 'couronne-de-noel', '', '', '', 'Christmas wreath', '', '', '', ''),
(29, 1, 5, '<p>¡Bonita corona para decorar la entrada de tu hogar!</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/COURONNE%20DE%20NOEL.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Corona de Navidad</p>', 'couronne-de-noel', '', '', '', 'Corona de Navidad', '', '', '', ''),
(29, 1, 6, '<p>Graziosa ghirlanda per decorare l\'ingresso di casa tua!</p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/COURONNE%20DE%20NOEL.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Ghirlanda natalizia</p>', 'couronne-de-noel', '', '', '', 'Ghirlanda natalizia', '', '', '', ''),
(30, 1, 1, '<p>Jolie guirlande lumineuse de Noël sur pile ! </p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/GUIRLANDES%20LUMINEUSE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>Guirlande lumineuse 2M</p>', 'guirlande-lumineuse-2m', 'Guirlande lumineuse sur pile', '', 'Guirlande lumineuse', 'Guirlande lumineuse 2M', '', '', 'Livraison entre 3 à 4 jours', 'Livraison entre 11 à 15 jours'),
(30, 1, 2, '<p>Hübsche Weihnachtslichtergirlande auf Batterie!</p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/GUIRLANDES%20LUMINEUSE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>2M Lichterketten</p>', 'guirlande-lumineuse-2m', '', '', '', '2M Lichterketten', '', '', '', ''),
(30, 1, 3, '<p>Mooie kerstlichtslinger op batterij!</p>\r\n<p></p>\r\n<p></p>\r\n<p></p><video width=\"300\" height=\"150\" controls=\"\">\r\n<source src=\"/prestashop/img/cms/GUIRLANDES%20LUMINEUSE.mp4\" type=\"video/mp4\"></source>\r\n</video>', '<p>2M lichtslingers</p>', 'guirlande-lumineuse-2m', '', '', '', '2M lichtslingers', '', '', '', ''),
